import React from 'react';

import { Container, MenuIcon ,LogotoTipo,FiPlus} from './styles';

function MobileHeader() {
  return (
          <Container>
            <button>
             <MenuIcon/>

            </button>

            <LogotoTipo>
              Divulgacar
            </LogotoTipo>


              <button>
                <FiPlus/>
                 Vender Veiculo
              </button>



          </Container>

  );
}

export default MobileHeader;
